import React from 'react';
import { makeStyles } from '@material-ui/core/styles';

import { Button, FormControlLabel, Checkbox } from '@material-ui/core';
import Paper from '../atoms/store-PaperAtom';
import Grid from '../atoms/store-GridAtom';
import Face from '../atoms/store-FaceAtom';
import TextField from '../atoms/store-TextFieldAtom';
import Fingerprint from '../atoms/store-FingerprintAtom';



const useStyles =  makeStyles((theme) => ({
    margin: {
        margin: theme.spacing.unit * 2,
    },
    padding: {
        padding: theme.spacing.unit
    }
}));
export default function StoreLoginMolecules(props){
    const classes = useStyles();

    return(
        <Paper className={classes.padding}>
        <div className={classes.margin}>
            <Grid container spacing={8} alignItems="flex-end">
                <Grid item>
                    <Face />
                </Grid>
                <Grid item md={true} sm={true} xs={true}>
                    <TextField id="username" label="Username" type="email" fullWidth autoFocus required />
                </Grid>
            </Grid>
            <Grid container spacing={8} alignItems="flex-end">
                <Grid item>
                    <Fingerprint />
                </Grid>
                <Grid item md={true} sm={true} xs={true}>
                    <TextField id="username" label="Password" type="password" fullWidth required />
                </Grid>
            </Grid>
            <Grid container alignItems="center" justify="space-between">
                <Grid item>
                    <FormControlLabel control={
                        <Checkbox
                            color="primary"
                        />
                    } label="Remember me" />
                </Grid>
                <Grid item>
                    <Button disableFocusRipple disableRipple style={{ textTransform: "none" }} variant="text" color="primary">Forgot password ?</Button>
                </Grid>
            </Grid>
            <Grid container justify="center" style={{ marginTop: '10px' }}>
                <Button variant="outlined" color="primary" style={{ textTransform: "none" }} onClick={() => { console.log('onClick'); }}>Login</Button>
            </Grid>
        </div>
    </Paper>
    );
}
